import React, { Component, useState } from "react";
import { VictoryLine, VictoryChart } from "victory";
import compHistory from './functions/compHistory';

export default class Tacos extends Component {
  constructor() {
    super();
    this.state = {
        data: [
            { x: 1, y: 2 },
            { x: 2, y: 3 },
            { x: 3, y: 5 },
            { x: 4, y: 4 },
            { x: 5, y: 7 }
        ]
      };
    // console.log(chart)
    }
    componentDidMount() {
        // this.setState({data: compHistory("AAPL", 1)})
    }
  render() {
      console.log(this.state.data)
    return (
      <div>
        <h1>Tacos per Day</h1>
        <VictoryChart>
          <VictoryLine
            data={this.state.data}
            style={{
              data: {
                stroke: "#02B875"
              }
            }}
          />
        </VictoryChart>
      </div>
    );
  }
}
